import React from 'react';

const Button = ({ text, arrow, href, underline }) => (
    <a 
    className={`arrow--btn ${underline === 'yes' ? 'underline' : ''}`} href={href}>
        <span>{text}</span>
        <img src={arrow} alt="" />
    </a>
)

export default Button
